import InputTerminal from './InputTerminal';
import Terminal from './Terminal';

class Game {
    constructor (){
        this.command_manager = new Terminal(this);
        this.input_manager = new InputTerminal(this.command_listener);
        this.input_manager.request_input();

        this.target;
        this.world = [
            {text:"test"}
        ];
    }

}

export default Game;
